import React, { useState } from "react";
import { Box, Link, CssBaseline, AppBar, Toolbar } from "@mui/material";

import Categories from "../../components/categories/categories.component";

import "./shop.styles.scss";
import { useNavigate } from "react-router-dom";

export const SubNavBar = () => {
  const [linkchoice, setLinkchoice] = useState("all");
  const navigateTo = useNavigate();
  const goToPageOnClick = () => {
    navigateTo("/Shop/" + linkchoice);
    navigateTo(0);
  };
  return (
    <Box className="Shopsubtitle">
      <CssBaseline />
      <AppBar
        // position="fix
        position="static"
        color="default"
        className="subnavbar"
        elevation={0}
      >
        <Toolbar className="_toolbar">
          <Link
            className="link"
            onClick={() => goToPageOnClick()}
            color="inherit"
            underline="hover"
          >
            All
          </Link>
          <Link className="link" href="#" color="inherit" underline="hover">
            Men
          </Link>
          <Link className="link" href="/Shop" color="inherit" underline="hover">
            Women
          </Link>
          <Link className="link" href="#" color="inherit" underline="hover">
            Jacketes
          </Link>
          <Link className="link" href="#" color="inherit" underline="hover">
            Hats
          </Link>
          <Link className="link" href="/" color="inherit" underline="hover">
            Pents
          </Link>
          <Link className="link" href="/" color="inherit" underline="hover">
            Shoes
          </Link>
        </Toolbar>
      </AppBar>
    </Box>
  );
};
const Shop = () => {
  return (
    <div className="shopContainer">
      <SubNavBar />
      <Box className="shopWrapper">
        <Categories />
      </Box>
    </div>
  );
};

export default Shop;
